import axios from "axios";
import { S3Client, PutObjectCommand } from "@aws-sdk/client-s3";

function getProduct(identifier, setProduct) {
  axios
    .post("/product", identifier)
    .then((res) => setProduct(res.data[0]))
    .catch((err) => console.log(err));
}

function getProducts(identifier, setProducts) {
  axios
    .post("/products", identifier)
    .then((res) => setProducts(res.data))
    .catch((err) => console.log(err));
}

function getFavorites(identifier, setFavorites) {
  axios
    .post("/favorites", identifier)
    .then((res) => setFavorites(res.data))
    .catch((err) => console.log(err));
}

function getUser(identifier, setUser) {
  axios
    .post("/user", identifier)
    .then((res) => setUser(res.data[0]))
    .catch((err) => console.log(err));
}

function getOrder(identifier, setOrder) {
  axios
    .post("/order", identifier)
    .then((res) => setOrder(res.data[0]))
    .catch((err) => console.log(err));
}

function getAddress(identifier, setAddress) {
  axios
    .post("/address", identifier)
    .then((res) => setAddress(res.data))
    .catch((err) => console.log(err));
}

function getPreferences(identifier, setPreferences) {
  axios
    .post("/preferences", identifier)
    .then((res) => setPreferences(res.data[0]))
    .catch((err) => console.log(err));
}

function createFavorite(identifier, setFavorite) {
  axios
    .post("/favorite/create", identifier)
    .then((res) => setFavorite(res.data))
    .catch((err) => console.log(err));
}

function createCart(identifier, setCart) {
  axios
    .post("/cart/create", identifier)
    .then((res) => setCart(res.data))
    .catch((err) => console.log(err));
}

function createUser(identifier, setUser) {
  axios
    .post("/user/create", identifier)
    .then((res) => setUser(res.data))
    .catch((err) => console.log(err));
}

function createShipping(identifier, setShipping) {
  axios
    .post("/shipping/create", identifier)
    .then((res) => setShipping(res.data))
    .catch((err) => console.log(err));
}

function createPayment(identifier, setPayment) {
  axios
    .post("/payment/create", identifier)
    .then((res) => setPayment(res.data))
    .catch((err) => console.log(err));
}

function createOrder(identifier, setOrder) {
  axios
    .post("/order/create", identifier)
    .then((res) => setOrder(res.data))
    .catch((err) => console.log(err));
}

function createAddress(identifier, setAddress) {
  axios
    .post("/address/create", identifier)
    .then((res) => setAddress(res.data))
    .catch((err) => console.log(err));
}

function createPreferences(identifier) {
  axios
    .post("/preferences/create", identifier)
    .catch((err) => console.log(err));
}

function deleteCart(identifier) {
  axios.post("/cart/delete", identifier).catch((err) => console.log(err));
}

function deleteAddress(identifier, setAddress) {
  axios
    .post("/address/delete", identifier)
    .then((res) => {
      setAddress(res.data);
    })
    .catch((err) => console.log(err));
}

function uploadImage(data, setImage) {
  const s3Client = new S3Client({
    region: "eu-north-1",
    credentials: {
      accessKeyId: "AKIAX5SITY7OE4TUY5O5",
      secretAccessKey: "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",
    },
  });
  const command = new PutObjectCommand({
    Bucket: "my-unique-ecommerce-v2",
    Key: `${Date.now()}_${data.name}`,
    Body: data,
    ContentType: data.type,
    ACL: "public-read",
  });
  s3Client
    .send(command)
    .then(() => {
      const url = `https://my-unique-ecommerce-v2.s3.eu-north-1.amazonaws.com/${Date.now()}_${
        data.name
      }`;
      console.log(url);
    })
    .catch((err) => console.log(err));
}

function updatePreferences(data, setPreferences) {
  axios
    .post("/preferences/update", data)
    .then((res) => setPreferences(res.data))
    .catch((err) => console.log(err));
}

function updateProduct(data, setProduct) {
  axios
    .post("/product/update", data)
    .then((res) => setProduct(res.data))
    .catch((err) => console.log(err));
}

function updateShipping(identifier, setShipping) {
  axios
    .post("/shipping/update", identifier)
    .then((res) => setShipping(res.data))
    .catch((err) => console.log(err));
}

function updateUser(identifier, setUser) {
  axios
    .post("/user/update", identifier)
    .then((res) => setUser(res.data))
    .catch((err) => console.log(err));
}

export {
  getProduct,
  getProducts,
  getFavorites,
  getUser,
  getOrder,
  getAddress,
  getPreferences,
  createFavorite,
  createCart,
  createUser,
  createShipping,
  createPayment,
  createOrder,
  createAddress,
  createPreferences,
  deleteCart,
  deleteAddress,
  uploadImage,
  updatePreferences,
  updateProduct,
  updateShipping,
  updateUser,
};
